    def start_scraping(self,response):
        album=response.css('.albumContainer')
        # print(album)
        for video in album:
            # videoCaption=video.css('.albumCaption a').css('::text').extract()
            videoPageUrl=response.urljoin(video.css('.albumCaption a').css('::attr(href)').get())
            # items['videoCaption']=videoCaption
            # items['videoLink']=videoPageUrl
            yield scrapy.Request(videoPageUrl,callback=self.getVideoLink)

    def getVideoLink(self,response):
        items=NottoVideoItem()
        videos=response.css('.litebox')
        for video in videos:
            videoCaption=video.css('::attr(title)').extract()
            videoLink=video.css('::attr(href)').extract()
            items['videoCaption']=videoCaption[0]
            items['videoLink']=videoLink
            yield items
